    false,nt"url": null,nt"notes": "This Chicago Park District dataset includes
    information about event permits requested through the Chicago Park District, including
    the name of applicant, the name of the event and a brief description, contact information,
    time of event including set-up and tear-down times, the name of the Park and location,
    and estimated number of event attendees. Additional information may be included
    depending on the type of the event, including proof of insurance, route maps for
    all races and runs, security plans and medical services and required city documents.
     Permit levels issued by the Department of Revenue include picnic levels, athletic
    levels, corporate levels, media levels, promotions levels, and festivals/performances
    levels. For more information, visit http://www.chicagoparkdistrict.com/permits-and-rentals/.",nt"license_title":
